{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPFGZiDhjVLuJjUh/ox126c"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","source":["import cv2\n","import numpy as np\n","import matplotlib.pyplot as plt\n","\n","# Create black canvas with white square\n","img = np.zeros((300, 300, 3), dtype=np.uint8)\n","cv2.rectangle(img, (80, 80), (220, 220), (255, 255, 255), -1)\n","\n","rows, cols = img.shape[:2]\n","\n","# Euclidean = rotation + translation (no scaling)\n","M = cv2.getRotationMatrix2D((cols/2, rows/2), 45, 1)  # rotate 45Â°\n","euclid_img = cv2.warpAffine(img, M, (cols, rows))\n","\n","plt.subplot(1, 2, 1), plt.imshow(cv2.cvtColor(img, cv2.COLOR_BGR2RGB)), plt.title(\"Original Square\")\n","plt.subplot(1, 2, 2), plt.imshow(cv2.cvtColor(euclid_img, cv2.COLOR_BGR2RGB)), plt.title(\"Euclidean\")\n","plt.show()"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":173},"id":"klXEbPnxDyjS","executionInfo":{"status":"ok","timestamp":1756527332049,"user_tz":-330,"elapsed":474,"user":{"displayName":"Priyadharshini M","userId":"06196304322668933057"}},"outputId":"0af8f05d-72a3-442a-f87f-6da6d61b5599"},"execution_count":1,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 2 Axes>"],"image/png":"\n"},"metadata":{}}]}]}